    <app-root>
      <style type="text/css">
        #pre-bootstrap {
          background-color: #333333;
          bottom: 0px;
          left: 0px;
          position: fixed;
          right: 0px;
          top: 0px;
          z-index: 999999;
        }
        #pre-bootstrap div.messaging {
          left: 0px;
          margin-top: -37px;
          position: absolute;
          right: 0px;
          top: 50%;
        }
        @keyframes spin {
          0% {
            transform: rotate(0deg);
          }
          100% {
            transform: rotate(360deg);
          }
        }
        #pre-bootstrap .pre-loading {
          margin-left: auto;
          margin-right: auto;
          border-radius: 50%;
          width: 24px;
          height: 24px;
          border: 0.25rem solid rgba(255, 255, 255, 0.2);
          border-top-color: rgb(255, 255, 255);
          animation: spin 1s infinite linear;
        }
      </style>

      <div id="pre-bootstrap">
        <div class="messaging">
          <div class="pre-loading"></div>
        </div>
      </div>
